- input: "TEXT\x1CC00522482\x1C.TEXT\x1C\x1CF3XA\x1CRE: ID#C00522482. This amended
    filing was prompted by your letter dated 2/12/2013. The original report was filed
    in error. It appears that an incomplete preliminary disbursements file was uploaded
    in lieu of the final completed file. As a result, the amended report addresses
    the items in your letter. Had the correct file been uploaded, none of the issues
    noted in your letter would have been included in the final version. Specifically,
    the negative amounts in Sched B, Line 29 were not voided checks. They were faulty
    data - a result of a volunteer initially incorrectly modifying records imported
    from our financial service providers correctly. All the items should have been
    recorded as expenditures. The 0.00 transactions were extraneous information, again
    the result of am import file from a financial services provider not being properly
    prepared. Additionally, the original report contained no record of our contributions.
    Note that the ending balance on the amended report matches the beginning balance
    on the subsequent 30 Day Post General report, as we continued to work off the
    correct file locally. We understand that the effects of thie mistake is that both
    contributions and expenses were under-reported, and that the Commission may choose
    to take further actions. We can only apoligize, assure you that our procedures
    have been modified to ensure this mistake does not happen again. - J.K.\n"
